import React, { Component } from 'react';

class Main extends Component {
  constructor(props) {
    super(props);
  
    this.state = {
       mouseOver: 'You\'re over'
    };
  }
  
  onMouseOver = () => {
    this.setState(prevState => {
      return { mouseOver: prevState.mouseOver + 'Over' };
    });
  }
  
  render() {
    return (
      <div>
        <input onMouseOver={this.onMouseOver} value={this.state.mouseOver} />     
      </div>
    );
  }
}

export default Main;
